# recursive algorithm brute-force creates all length n lists with int <= k
def potential_sols_generator(n, k, potential_sols = [[]]):
    
    if n == 0:
        return potential_sols
    
    else:
        p_sols = []
        
        for potential_sol in potential_sols:
            for i in range(k+1):
                p_sols.append(potential_sol + [i])
                
        return potential_sols_generator(n-1, k, p_sols)
    
    
# finds all possible degrees of variables    
def sols_generator(n, k):
    
    sols = []
    potential_sols = potential_sols_generator(n, k)
    
    for potential_sol in potential_sols:
        if sum(potential_sol) <= k:
            sols.append(potential_sol)
            
    return sols


